import React from 'react';

import WeeklySchedule from './WeeklySchedule.jsx';
import PacmanLoad from 'react-spinners/PacmanLoader';

import './ScheduleViewer.scss';

export default class ScheduleViewer extends React.Component {
    constructor(props) {
        super(props);

        this.courses     = props.courses;
        this.instructors = props.instructors;

        this.state = {
            schedule: null
        };
    }

    componentDidMount() {
        //console.log( this.courses );
        this.run_scheduler();
    }

    run_scheduler() {
        window.pypyjs.ready().then(function() {
            return window.pypyjs.execfile('../../main.py');
        }).then(function() {
            return window.pypyjs.get('x');
        }).then(function(result) {
            console.log(result);
        });
    }

    render() {
        console.log(this.state.schedule);
        return (
            <>
                { this.state.schedule ?

                    <WeeklySchedule schedule = {this.state.schedule} />

                :

                    <div className="sv-loading">
                        <PacmanLoad size='50px' color='white' />
                    </div>
                }
            </>
        );
    }
}

let courses = {}
let i = 0;
jQuery('[id*="contentDivImg"]:not([id*="contentDivImg_"])').each(function() {
    let _this = this;
    jQuery(_this).find('tr').each(function(index) {
        let _this_ = this;
        if ( index ) {
            let children = jQuery(_this_).children();
            courses[i] = {};
            courses[i]['class_num']   = children[1].innerText;
            courses[i]['section_num'] = children[2].innerText.substr(0,2);
            courses[i]['day_time']    = children[3].innerText;
            courses[i]['room']        = children[4].innerText;
            courses[i]['instructor']  = children[5].innerText;
            i++;
        }
    });
});
var jsonObject = JSON.stringify(courses);
// Display JSON
jQuery('#json').text(jsonObject);
// Convert JSON to CSV & Display CSV
jQuery('#csv').text(ConvertToCSV(jsonObject));
